        numero = _numero;
    }

    function mensaje() public view returns (string memory) {
        if (numero > 18) {
            return "puedes ingresar eres mayor de edad";
        } else if (numero == 18) {
            return "acabas de cumplir 18 puedes ingresar";
        } else {
            return "eres menor de edad no puedes ingresar";
        }
    }
}

